import { Fragment } from "react";

import mealsImage from "../../assets/food-wallpaper.jpg";

const Header = (props) => {
  // Using Fragment as a wrapper.
  return (
    <Fragment>
      <header>
        <h1>JustEat</h1>
        <button>Cart</button>
      </header>
      <div>
        <img
          src={mealsImage}
          alt="Table of delicious asian food"
          className="w-full"
        />
      </div>
    </Fragment>
  );
};

export default Header;
